// import logo from './logo.svg';
import './App.css';
import React from 'react';
import ExpenseItem from './components/ExpenseItem';

function App() {
  return (
    <div>
      <ExpenseItem date="2020-01-01" name="Car Insurance" price="290.34" />
      <ExpenseItem date="2021-01-01" name="Mutual Funds" price="200000" />
      <ExpenseItem date="2022-01-01" name="Stocks" price="1020" />
      <ExpenseItem date="2023-01-01" name="Laptop Servicing" price="900" />
      <ExpenseItem date="2024-01-01" name="" price="91010" />
    </div>
  );
}

export default App;
